import React from 'react';

class Form extends React.Component {
  constructor() {
    super();

    this.state = {
      name: ['Brian', 'Blanche']
    };
  }

  render() {
    console.log(this.state)
    return (
      <div className="form">
        <form>
          <input />
          <input type="submit" value="Submit" />
        </form>
      </div>
    )
  }
}

export default Form;
